function custom_Pager(a, b) {
    var e, f, g;
    var g = 5;
    var h = Math.ceil(b.RecordCount / b.PageSize);
    if (b.PageIndex > h) {
        b.PageIndex = h
    }
    var i = "";
    i += "<div class='row'>";
    if (h >= 1) {
        f = h > g ? g : h; e = b.PageIndex > 1 && b.PageIndex + g - 1 < g ? b.PageIndex : 1;
        if (b.PageIndex > g % 2) {
            if (b.PageIndex == 2) f = 5;
            else f = b.PageIndex + 2
        } else {
            f = g - b.PageIndex + 1
        }
        if (f - (g - 1) > e) {
            e = f - (g - 1)
        }
        if (f > h) {
            f = h; e = f - g + 1 > 0 ? f - g + 1 : 1
        }
        var j = (b.PageIndex - 1) * b.PageSize + 1;
        var k = j + b.PageSize - 1;
        if (k > b.RecordCount) {
            k = b.RecordCount
        }
        //i = "<b>Records " + (j == 0 ? 1 : j) + " - " + k + " of " + b.RecordCount + "</b> ";
        i += "<div class='col-sm-12 col-md-5'><div class='dataTables_info' id='example2_info' role='status' aria-live='polite'>Showing " + (j == 0 ? 1 : j) + " to " + k + " of " + b.RecordCount + " entries</div></div>";
        i += "<div class='col-sm-12 col-md-7'>";
        i += "<div class='dataTables_paginate paging_simple_numbers ' id='example2_paginate'>";
        i += "<ul class='pagination float-right'>";

        if (b.PageIndex > 1) {
            i += "<li class='paginate_button page-item first' id='example2_first'><a class='page-link page' page = '{1}' aria-controls='example2' data-dt-idx='0' tabindex='0'>{0}</a></li>";
            i = i.replace('{0}', 'First').replace('{1}', '1');
            i += "<li class='paginate_button page-item previous' id='example2_previous'><a class='page-link page' page = '{3}' aria-controls='example2' data-dt-idx='0' tabindex='0'>{2}</a></li>";
            i = i.replace('{2}', 'Previous').replace('{3}', b.PageIndex - 1)
        }
        for (var l = e; l <= f; l++) {
            if (l == b.PageIndex) {
                i += "<li class='paginate_button page-item active'><a href='#' aria-controls='example2' data-dt-idx='1' tabindex='0' class='page-link'>{4}</a></li>";
                i = i.replace('{4}', l)
            }
            else {
                i += "<li class='paginate_button page-item' id='example2_previous'><a class='page-link page' page = '{6}' aria-controls='example2' data-dt-idx='0' tabindex='0'>{5}</a></li>";
                i = i.replace('{5}', l).replace('{6}', l)
                //i = i.replace('{0}', l).replace('{1}', l);                
            }
        }
        if (b.PageIndex < h) {
            i += "<li class='paginate_button page-item next' id='example2_next'><a class='page-link page' page = '{8}' aria-controls='example2' data-dt-idx='7' tabindex='0'>{7}</a></li>";
            i = i.replace('{7}', 'Next').replace('{8}', b.PageIndex + 1);

            i += "<li class='paginate_button page-item last' id='example2_next'><a class='page-link page' page = '{10}' aria-controls='example2' data-dt-idx='7' tabindex='0' >{9}</a></li>";
            i = i.replace('{9}', 'Last').replace('{10}', h)
        }
        i += "</ul>";
        i += "</div>";
        i += "</div>";
    }

    i += "</div>";
    a.html(i);
    try { a[0].disabled = false } catch (m) { }
}
(function (a) {
    a.fn.custom_Pager = function (b) {
        var c = {};
        var b = a.extend(c, b);
        return this.each(function () { custom_Pager(a(this), b) })
    }
})(jQuery);